import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var Battery = createReactComponent("Battery", ["svg", defaultAttributes, [["rect", {
  x: "2",
  y: "7",
  width: "16",
  height: "10",
  rx: "2",
  ry: "2",
  key: "174y1r"
}], ["line", {
  x1: "22",
  x2: "22",
  y1: "11",
  y2: "13",
  key: "13axwy"
}]]]);
export default Battery;
